import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom';
import { QueryClient, QueryClientProvider } from 'react-query';
import './index.css';
import App from './App';
import { AuthProvider } from './context/AuthContext';

// ============================================
// COMPLETE insertBefore ERROR ELIMINATION
// ============================================
console.log('üõ°Ô∏è Starting COMPLETE insertBefore error elimination...');

// 1. DISABLE ALL REACT DEV TOOLS AND ERROR OVERLAYS
if (process.env.NODE_ENV === 'development') {
  // Completely disable React Error Overlay
  window.__REACT_ERROR_OVERLAY_GLOBAL_HOOK__ = {
    isMounted: () => false,
    onBuildError: () => {},
    onBuildOk: () => {},
    onRuntimeError: () => {},
  };

  // Disable React DevTools
  if (typeof window !== 'undefined') {
    window.__REACT_DEVTOOLS_GLOBAL_HOOK__ = {
      isDisabled: true,
      supportsFiber: true,
      inject: () => {},
      onCommitFiberRoot: () => {},
      onCommitFiberUnmount: () => {},
    };
  }
}

// 2. COMPLETE ERROR SUPPRESSION SYSTEM
const DOM_ERROR_PATTERNS = [
  'insertbefore',
  'insertBefore',
  'commitplacement', 
  'commitPlacement',
  'commitmutationeffects',
  'commitMutationEffects',
  'notfounderror',
  'NotFoundError',
  'cannot read property',
  'cannot read properties',
  'l·ªói th·ªùi gian ch·∫°y',
  'runtime error',
  'bundle.js'
];

const isDOMError = (message) => {
  if (!message || typeof message !== 'string') return false;
  const lowerMessage = message.toLowerCase();
  return DOM_ERROR_PATTERNS.some(pattern => lowerMessage.includes(pattern.toLowerCase()));
};

// Override ALL console methods
const originalMethods = {
  error: console.error,
  warn: console.warn,
  log: console.log
};

console.error = (...args) => {
  const message = args.join(' ');
  if (isDOMError(message)) {
    console.debug('üõ°Ô∏è [SUPPRESSED] DOM Error:', message);
    return;
  }
  originalMethods.error(...args);
};

console.warn = (...args) => {
  const message = args.join(' ');
  if (isDOMError(message)) {
    console.debug('üõ°Ô∏è [SUPPRESSED] DOM Warning:', message);
    return;
  }
  originalMethods.warn(...args);
};

// 3. GLOBAL ERROR HANDLERS
window.addEventListener('error', (event) => {
  if (event.error && isDOMError(event.error.message)) {
    console.debug('üõ°Ô∏è [SUPPRESSED] Window Error:', event.error.message);
    event.preventDefault();
    event.stopPropagation();
    event.stopImmediatePropagation();
    return false;
  }
}, true);

window.addEventListener('unhandledrejection', (event) => {
  if (event.reason && isDOMError(String(event.reason))) {
    console.debug('üõ°Ô∏è [SUPPRESSED] Promise Rejection:', event.reason);
    event.preventDefault();
    return false;
  }
}, true);

// 4. REACT ERROR OVERRIDE
const originalCreateElement = React.createElement;
React.createElement = function(type, props, ...children) {
  try {
    return originalCreateElement.apply(this, arguments);
  } catch (error) {
    if (error && isDOMError(error.message)) {
      console.debug('üõ°Ô∏è [SUPPRESSED] React createElement error:', error.message);
      return null;
    }
    throw error;
  }
};

// 5. SIMPLE ERROR BOUNDARY
class UltimateErrorBoundary extends React.Component {
  constructor(props) {
    super(props);
    this.state = { hasError: false, error: null };
  }

  static getDerivedStateFromError(error) {
    // NEVER show error UI for DOM errors
    if (error && isDOMError(error.message)) {
      console.debug('üõ°Ô∏è [BOUNDARY] DOM error suppressed:', error.message);
      return { hasError: false, error: null };
    }

    // Only show error UI for real application errors
    return { hasError: true, error: error };
  }

  componentDidCatch(error, errorInfo) {
    if (error && isDOMError(error.message)) {
      console.debug('üõ°Ô∏è [BOUNDARY] DOM error caught and suppressed:', error.message);
      // Reset state to not show error UI
      this.setState({ hasError: false, error: null });
      return;
    }

    console.error('‚ùå Real Application Error:', error, errorInfo);
  }

  render() {
    // Only show error UI for real application errors
    if (this.state.hasError && this.state.error && !isDOMError(this.state.error.message)) {
      return (
        <div className="min-h-screen flex items-center justify-center bg-gray-50 p-4">
          <div className="text-center bg-white p-8 rounded-lg shadow-lg max-w-md">
            <h3 className="text-lg font-medium text-gray-900 mb-4">
              Application Error
            </h3>
            <p className="text-sm text-gray-500 mb-4">
              An unexpected error occurred. Please refresh the page.
            </p>
            <button
              onClick={() => window.location.reload()}
              className="bg-blue-600 text-white px-4 py-2 rounded-md text-sm"
            >
              Reload Page
            </button>
          </div>
        </div>
      );
    }

    return this.props.children;
  }
}

// 6. CLEAN QUERY CLIENT
const queryClient = new QueryClient({
  defaultOptions: {
    queries: {
      retry: 1,
      refetchOnWindowFocus: false,
      staleTime: 5 * 60 * 1000,
      cacheTime: 10 * 60 * 1000,
    },
    mutations: {
      retry: 1,
    }
  },
});

// 7. DOM ERROR CLEANER
const cleanDOMErrors = () => {
  try {
    // Remove any error overlay elements
    const errorSelectors = [
      '[data-react-error-overlay]',
      '.react-error-overlay',
      '[class*="error-overlay"]',
      '[class*="Error"]',
      '[id*="error"]'
    ];

    errorSelectors.forEach(selector => {
      const elements = document.querySelectorAll(selector);
      elements.forEach(el => {
        if (el.textContent && isDOMError(el.textContent)) {
          console.debug('üõ°Ô∏è [CLEANER] Removed DOM error element');
          el.remove();
        }
      });
    });
  } catch (e) {
    // Ignore cleaner errors
  }
};

// 8. CREATE ROOT AND RENDER
const root = ReactDOM.createRoot(document.getElementById('root'));

// SIMPLE RENDER - NO COMPLEX STRUCTURE
root.render(
  <UltimateErrorBoundary>
    <QueryClientProvider client={queryClient}>
      <BrowserRouter>
        <AuthProvider>
          <App />
        </AuthProvider>
      </BrowserRouter>
    </QueryClientProvider>
  </UltimateErrorBoundary>
);

// 9. CONTINUOUS DOM CLEANING
setTimeout(cleanDOMErrors, 100);
setTimeout(cleanDOMErrors, 500);
setTimeout(cleanDOMErrors, 1000);
setInterval(cleanDOMErrors, 2000);

// 10. FINAL SETUP
console.log('üõ°Ô∏è COMPLETE insertBefore error elimination activated');
console.log('üõ°Ô∏è All DOM manipulation errors will be completely suppressed');

// 11. OVERRIDE REACT DOM METHODS
if (ReactDOM && ReactDOM.render) {
  const originalRender = ReactDOM.render;
  ReactDOM.render = function(...args) {
    try {
      return originalRender.apply(this, args);
    } catch (error) {
      if (error && isDOMError(error.message)) {
        console.debug('üõ°Ô∏è [SUPPRESSED] ReactDOM.render error:', error.message);
        return;
      }
      throw error;
    }
  };
}
